<script lang="ts">
    import { onMount } from 'svelte';
    import type { Writable } from 'svelte/store';
    import { writable } from 'svelte/store';

    export let airQualityData: Writable<Array<{ stationName: string; khaiValue: number; }>> = writable([]);

    let colors = {};
    let tooltips = {};

    const calculateColor = (value) => {
        if (value <= 25) return '#27ae60';    // 매우 좋음
        if (value <= 50) return '#2ecc71';    // 좋음
        if (value <= 75) return '#f1c40f';    // 양호
        if (value <= 100) return '#f39c12';   // 보통
        if (value <= 125) return '#e67e22';   // 약간 나쁨
        if (value <= 150) return '#d35400';   // 나쁨
        if (value <= 175) return '#e74c3c';   // 매우 나쁨
        if (value <= 200) return '#c0392b';   // 심각
        return '#8e44ad';                     // 매우 심각
    };

    onMount(() => {
        airQualityData.subscribe(data => {
            data.forEach(({ stationName, khaiValue }) => {
                colors[stationName] = calculateColor(khaiValue);
                tooltips[stationName] = `${stationName}: ${khaiValue}`;
            });
        });
    });
</script>

